INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`) VALUES ('67', '1', 'Accessories', '&lt;div&gt;\r\n\t&lt;h1&gt;\r\n\t\t&lt;span style=&quot;color:#ffffff;&quot;&gt;&lt;span style=&quot;background-color: rgb(0, 0, 0);&quot;&gt;Mens &amp;amp; Womens Accessories – Shop Online&lt;/span&gt;&lt;/span&gt;&lt;/h1&gt;\r\n&lt;/div&gt;\r\n&lt;p&gt;\r\n\tShop online for womens and mens accessories. Get FREE shipping. Bags, caps, backpacks, beach accessories, beach towels, wallets, jewellery, hats, beanies, scarves, belts, pencil cases, hair accessories &amp;amp; more. Top brands like Billabong, Roxy, Unit, Rusty, Volcom, Hurley, Mojito and Mooloola. 100 day exchanges and refunds. Free Express Shipping for orders over $10. Shop online now.&lt;/p&gt;\r\n', '', '');
INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`) VALUES ('66', '1', 'Dickies', '&lt;p style=&quot;font-family:Arial, Helvetica, sans-serif; font-size:12px; font-weight:bold; padding-top:5px; color:#43B549;&quot;&gt;\r\n\tQUALITY WORKWEAR SINCE 1922&lt;/p&gt;\r\n&lt;p&gt;\r\n\tSince 1922&amp;nbsp;&lt;strong&gt;Dickies&amp;nbsp;&lt;/strong&gt;been renown for making quality work wear and throughout the brand’s long heritage Dickies have been pioneers of the chino pant. Dickies is a trusted brand and by adapting the fit of the original 874 pant Dickies have extended their pant line to offer a wide range of fits, fabrics and colourways. Dickies have also partnered with Atomic and other licensees throughout the world to become a leading supplier of classic streetwear and lifestyle apparel.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tDickies products are just like the people who wear them. Real. Dickies guarantee consumer satisfaction and offer a lifetime guarantee on selected products. The longevity of the Dickies brand demonstrates an unwavering commitment to deliver durable products which are manufactured to withstand the pressures of everyday life.&lt;/p&gt;\r\n', '', '');
INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`) VALUES ('65', '1', 'Brands', '', '', '');
INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`) VALUES ('59', '1', 'Tees', '&lt;h1&gt;\r\n\t&lt;span style=&quot;font-size:22px;&quot;&gt;&lt;span style=&quot;color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;background-color: rgb(0, 0, 0);&quot;&gt;T-Shirts - Fashion, Summer, Surf &amp;amp; Skate Tees&amp;nbsp; - Shop Online&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h1&gt;\r\n&lt;p&gt;\r\n\tNew summer t-shirts added daily.&amp;nbsp; Shop our massive range of men\'s fashion t-shirts online &amp;amp; get FREE shipping. Leading fashion, clothing, surf &amp;amp; skate shop since 1985. Our clothing and fashion store has tees to suit every style. Huge range from top brands like Quiksilver, Rip Curl, Unit, Billabong, Hurley, Fox, Nena &amp;amp; Pasadena and more. 100 day exchanges and refunds. Free Express Shipping for orders over $10. Shop online now.&lt;/p&gt;\r\n', '', '');
