INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`) VALUES ('61', '1', 'Men', '&lt;h1&gt;\r\n\t&lt;span style=&quot;font-size:22px;&quot;&gt;&lt;span style=&quot;color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;background-color: rgb(0, 0, 0);&quot;&gt;Men\'s T-Shirts - Fashion, Summer, Surf &amp;amp; Skate Tees&amp;nbsp; - Shop Online&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h1&gt;\r\n&lt;p&gt;\r\n\tNew summer t-shirts added daily.&amp;nbsp; Shop our massive range of men\'s fashion t-shirts online &amp;amp; get FREE shipping. Leading fashion, clothing, surf &amp;amp; skate shop since 1985. Our clothing and fashion store has tees to suit every style. Huge range from top brands like Quiksilver, Rip Curl, Unit, Billabong, Hurley, Fox, Nena &amp;amp; Pasadena and more. 100 day exchanges and refunds. Free Express Shipping for orders over $10. Shop online now.&lt;/p&gt;\r\n', '', '');
INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`) VALUES ('62', '1', 'Women', '&lt;div&gt;\r\n\t&lt;h1&gt;\r\n\t\t&lt;span style=&quot;color:#ffffff;&quot;&gt;&lt;span style=&quot;background-color:#000000;&quot;&gt;Women\'s Tops - Shop Online &amp;amp; Get Free Shipping&lt;/span&gt;&lt;/span&gt;&lt;/h1&gt;\r\n&lt;/div&gt;\r\n&lt;p&gt;\r\n\tShop online for the best in women\'s fashion tops. Get FREE Shipping. Leading fashion store since 1985. Our online store has a wide range of tops, shirts, tank tops, crops tops &amp;amp; more. Top designs from top brands like Mooloola, Mink Pink &amp;amp; Mojito.&amp;nbsp; 100 day exchanges and refunds. Free Express Shipping for orders over $10. Shop online now.&lt;/p&gt;\r\n', '', '');
