INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`) VALUES ('68', '1', 'Hats', '&lt;div id=&quot;header_box&quot;&gt;\r\n\t&lt;div&gt;\r\n\t\t&lt;h1&gt;\r\n\t\t\t&lt;span style=&quot;color:#ffffff;&quot;&gt;&lt;span style=&quot;background-color:#000000;&quot;&gt;Men\'s &amp;amp; Women\'s Headwear - Shop Online&lt;/span&gt;&lt;/span&gt;&lt;/h1&gt;\r\n\t&lt;/div&gt;\r\n\t&lt;div class=&quot;description&quot;&gt;\r\n\t\tShop online for men’s, women’s, boy’s and girl’s caps, hats, beanies, hair accessories. Shop now &amp;amp; get FREE shipping. Flat caps, flex fit caps, snapback hats, fedora hats, trucker hats, baseball hats and caps, bucket hats, floppy hats, fudd hats, knitted beanies, animal beanies, scarves, headbands, hairpins, bandanas and more. Top brands like New Era, Neff, Billabong, Element, Roxy, Rusty and Volcom. 100 day exchanges and refunds. Free Express Shipping for orders over $10. Shop online now.&lt;/div&gt;\r\n&lt;/div&gt;\r\n&lt;p&gt;\r\n\t&amp;nbsp;&lt;/p&gt;\r\n', '', '');
INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`) VALUES ('69', '1', 'Offical', '&lt;p style=&quot;font-family:Arial, Helvetica, sans-serif; font-size:12px; font-weight:bold; padding-top:5px; color:#43B549;&quot;&gt;\r\n\tPARTY LIKE A ROCKSTAR&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&lt;strong&gt;Official Crown of Laurel &lt;/strong&gt;is a premium headwear brand that is based in San Francisco, California. The brand was founded in 2007 when the crew identified that there was a void in the market for premium headwear that needed to be filled. Drawing inspiration from various influences including skate, street and DIY fashion they created a headwear brand with unique appeal.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tOfficial regards its headwear as a crown, a statement, an exclamation point and sometimes a simple compliment to bigger and bolder things. They take great joy in applying this concept to each and every piece they produce under the Official Crown of Laurel label.&lt;/p&gt;\r\n', '', '');
INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`) VALUES ('70', '1', 'Famous', '&lt;p style=&quot;font-family:Arial, Helvetica, sans-serif; font-size:12px; font-weight:bold; padding-top:5px; color:#43B549;&quot;&gt;\r\n\tDOIN\' THE DAMN THING SINCE 1999&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&lt;strong&gt;Famous Stars and Straps (FSAS)&lt;/strong&gt; is an American-based clothing and accessory line, which is owned by Travis Barker, best known as the drummer of punk rock band Blink 182. Influenced by Barker’s background the Famous Stars and Straps brand is built on ‘the fast life’ and resonates with all aspects of music, action sport and street culture, from skateboarding to the punk rock scene and hip-hop street culture.&lt;br /&gt;\r\n\t&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;\r\n\tThe Famous SAS logo symbolizes the ability to ‘Stand Alone’ and this ‘Badge of Honor’ is an integral part of the brand. Resembling an old car badge, the ‘F’ is used in tag lines such as ‘Family’ and ‘Forever.’ These tags have been inked in a tattoo script and stand for the values that the brand is built on.&lt;/p&gt;\r\n', '', '');
INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`) VALUES ('71', '1', 'Osiris', '&lt;p style=&quot;font-family:Arial, Helvetica, sans-serif; font-size:12px; font-weight:bold; padding-top:5px; color:#43B549;&quot;&gt;\r\n\tSHOES TO MAKE YOUR FEET LOOK GOOD&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&lt;strong&gt;Osiris Shoes &lt;/strong&gt;are an American-based company that design and manufacture skate shoes that are sold throughout the world. The Osiris shoe collection includes pro-endorsed signature and team models developed specifically for skateboarding, as well as lifestyle and special edition models that are suitable for everyday casual wear.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tKnown for their attention to detail and innovative technical features, Osiris Shoes lay claim to the best selling promodel skate shoe of all time, ‘The D3’ and more recently for leading the resurgence in high tops with the release of their popular ‘The NYC 83’ model.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tWith an eye for originality, each season the design team at Osiris also incorporate artist collaborations into their distinct ‘Canvas’ range, handing over free reign to painters, illustrators, tattooists and graffiti artists including the likes of O.G. Abel, Maxx 242, Lase, John Grow and Joe King. These collectable styles have proved incredibly popular with sneaker fans and are also amongst some of the brands best selling styles.&lt;/p&gt;\r\n', '', '');
INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`) VALUES ('72', '1', 'Zaphyr', '&lt;p style=&quot;font-family:Arial, Helvetica, sans-serif; font-size:12px; font-weight:bold; padding-top:5px; color:#43B549;&quot;&gt;\r\n\tTHE Z HAT&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&lt;strong&gt;Zephyr &lt;/strong&gt;is the manufacturer of the iconic authentic US college and sporting team hats. The brand has a very loyal following amongst die-hard hat collectors and has been the innovator of many of the styles and treatments that are now commonplace in headwear design today. The team is passionate about hockey and Zephyr\'s NHL collection is a true manifestation of the love they have for the sport. Zephyr also channel the same passion and creativity into building custom hats for all of the leading American colleges and sports teams, producing hats featuring the names of emblems of all of the leading NBA, NFL and NHL teams and colleges and universities.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tCoveted by hat collectors, Zephyr Hats is one of the leading brands in the headwear market and the preferred choice of millions of consumers worldwide. The success of the Zephyr hat company is based upon its understanding of the consumer. The Zephyr brand is synonymous with quality headwear and prides itself on being the industry leader in customer satisfaction, delivery and design.&lt;/p&gt;\r\n', '', '');
