INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`) VALUES ('84', '1', 'OS_Abel', '&lt;p style=&quot;font-family:Arial, Helvetica, sans-serif; font-size:12px; font-weight:bold; padding-top:5px; color:#43B549;&quot;&gt;\r\n\tTHE MARK OF THE BEST&lt;/p&gt;\r\n&lt;p&gt;\r\n\tGrowing up in the ghetto of Compton, from a very young age &lt;strong&gt;OG Abel&lt;/strong&gt; was a witness to gang violence and crime on the streets. During his childhood OG Abel lost his beloved brother who fell victim to that same violence. Hardened by the tragedy, Abel would express his grief through his passion for graffiti and empowered by his late brother’s dream of becoming an artist he began to make a name for himself on the streets of Los Angeles.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tDetermined to turn his life around, Abel attended Los Angeles Trade Tech College where he took a course in graphic design. The LA graffiti artist-turned-designer now lays claim to a signature toy line and his signature clothing line, the OG Abel collection, is fast becoming one of the worlds most sought after street-wear brands.&lt;/p&gt;\r\n', '', '');
INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`) VALUES ('85', '1', 'Tapout', '&lt;p style=&quot;font-family:Arial, Helvetica, sans-serif; font-size:12px; font-weight:bold; padding-top:5px; color:#43B549;&quot;&gt;\r\n\tAN EXPRESSION OF COMBAT&lt;/p&gt;\r\n&lt;p&gt;\r\n\t&lt;strong&gt;TapouT &lt;/strong&gt;is the world’s most prominent MMA clothing company. Represented by some of the biggest superstars of the UFC, the impactful TapouT logo now graces everything from clothing, accessories and fight gear to nutritional products, bottled water, a hit reality television series and even a magazine! With its cult allegiance of fans TapouT has helped to elevate extreme fighting to the mainstream arena and is fast becoming one of the most recognized street-wear brands in the world.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tMixed Martial Arts was once deemed too vicious for society, but with the rules modified and safety regulations firmly in place MMA is now the fastest growing sport in the world! Millions of fans across the globe tune in to watch combatants battle for supremacy in the cage whilst competing in the acclaimed ‘UFC’ series. The growth of mixed martial arts has also given rise to the hit reality television show ‘The Ultimate Fighter’ series. As a presenting sponsor of the UFC and ‘The Ultimate Fighter’ television series, TapouT is regarded as the major supporter of the sport.&lt;/p&gt;\r\n', '', '');
INSERT INTO `category_description` (`category_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`) VALUES ('87', '1', 'Underwear&amp;Sleepwear', '&lt;div id=&quot;features&quot; style=&quot;display: block;&quot;&gt;\r\n\t&lt;div&gt;\r\n\t\t&lt;h1&gt;\r\n\t\t\t&lt;span style=&quot;color:#ffffff;&quot;&gt;&lt;span style=&quot;background-color:#000000;&quot;&gt;Women\'s Underwear &amp;amp; Sleepwear - Shop Online - Free Shipping&lt;/span&gt;&lt;/span&gt;&lt;/h1&gt;\r\n\t&lt;/div&gt;\r\n\tShop online for women\'s undies, bras, underwear, bandeaus, pyjamas, pyjama pants, knickers, hotpants, crop tops and knickers sets. Get Free Shipping. Leading fashion store since 1985. Shop from top brands like Mooloola, Unit, Sleepy Squirrel, Sly Underwear, Roxy, Volcom &amp;amp; more.&amp;nbsp; 100 day exchanges and refunds. Free Express Shipping for orders over $10. Shop online now.&lt;/div&gt;\r\n&lt;p&gt;\r\n\t&amp;nbsp;&lt;/p&gt;\r\n', '', '');
