INSERT INTO `information_description` (`information_id`, `language_id`, `title`, `description`) VALUES ('4', '1', 'About Us', '&lt;p&gt;\r\n\t&lt;strong&gt;&lt;span style=&quot;padding-left: 0px; color: #42b649;&quot;&gt;&lt;img alt=&quot;About Us&quot; src=&quot;http://127.0.0.1/AtomicFM/image/data/Informations/aboutus-right-img.gif&quot; style=&quot;width: 381px; height: 328px; border-width: 0px; border-style: solid; margin: 0px; float: right;&quot; /&gt;Atomic Fashion Marketing Pty Ltd&lt;/span&gt;&lt;/strong&gt;&lt;br /&gt;\r\n\tis an Australian owned and operated private company, which has long been credited as a market-leader in the street-wear business. Managing Director, Peter Antoine, founded the business in 1988 and built a name for his business during the 90’s, when Atomic secured the Australian distribution rights to one of most successful skate brands in the world, Airwalk. Operating as ‘Airwalk Australia’, Atomic worked closely with the international team to transform the skate-inspired label into a popular lifestyle brand that had huge commercial appeal.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tAtomic then expanded into the global marketplace through a partnership with the US-based street-wear brand, Emily the Strange. In 2006 Atomic was appointed as the global licensee and worked hard to establish an extensive distribution network in the international market. During the brand’s peak Atomic’s products were sold in&amp;nbsp;twenty-three countries throughout Europe, Asia and America.&lt;br /&gt;\r\n\t&lt;br /&gt;\r\n\tNow more than twenty years on, Atomic has evolved to become one of the most dominant street-wear wholesalers in the country, representing some of the biggest brands in action sport! Atomic is an innovative, dynamic organization and through our involvement in the licensing, management and distribution of branded street-wear, we have played an integral role in building many national and international brands in Australia and within the global marketplace.&lt;/p&gt;\r\n');
